import React from 'react';
import styled from '@emotion/styled';

let ContenedorHeader = styled.header`
    background-color: #26C6DA;
    padding: 10px;
    font-weight: bold;
    color:#FFFFFF;
`;

const Header = ({titulo}) => {
    return ( 
        <ContenedorHeader>
            <h1>{titulo}</h1>
        </ContenedorHeader>
     );
}

export default Header;
